import './App.css';

function App() {
  return (
    <div className='container'>
      <h1>How fast can you type?</h1>
      <textarea />

      <h4>Time remaining</h4>
      <button>Start Game</button>
      <h1>Word count</h1>
    </div>

  );
}

export default App;
